def bin_neural_data(neural_data):
  binned_neural_data = np.zeros((neural_data.shape[0],num_trials,maximum_trial_length))
  for i in range(0,neural_data.shape[0]):
    for j in range(0,num_trials):
      trial_lengths[j] = np.where(frames_with_trial_indices==j)[0].shape[0]
      binned_neural_data[i,j,:] = np.concatenate([neural_data[i,np.where(frames_with_trial_indices==j)][0],np.zeros(maximum_trial_length - neural_data[i,np.where(frames_with_trial_indices==j)][0].shape[0])])
  return binned_neural_data
