from scipy.signal import resample
target_number_frames = np.nanmean(trial_lengths).astype(int) #We'll downsample trials with more frames than average and interpolate/upsample trials with fewer frames than average
def downupsample_data(binned_data,target_number_frames):
  rebinned_array = np.zeros((binned_data.shape[0],binned_data.shape[1],target_number_frames))
  for i in range(0,binned_data.shape[0]):
    for j,trial in enumerate(binned_data[i]):
      original_trial_array = np.array(trial)
      original_trial_array = original_trial_array[original_trial_array!=0]
      current_length = original_trial_array.shape[0]
      if current_length > target_number_frames:
        rebinned_array[i,j,:] = resample(original_trial_array,target_number_frames)
      elif current_length < target_number_frames:
        interpolated_array = np.interp(np.linspace(0,1,target_number_frames),np.linspace(0,1,current_length),original_trial_array)
        rebinned_array[i,j,:] = interpolated_array
      else:
        rebinned_array[i,j,:] = original_trial_array
    return rebinned_array

fortypc_resampled = downupsample_data(forty_pc_binned_data,target_number_frames)
