from sklearn.metrics import accuracy_score
from torch.utils.data import TensorDataset, DataLoader

# interp_spk: shape = (n_neurons, n_trials, n_timepoints)
# reshape it to (n_trials, n_neurons, n_timepoints)

X_all = np.nan_to_num(interp_spk)  # Replace NaN with 0
X_all = np.transpose(X_all, (1, 0, 2))  # (trials, channels=neurons, time)
y_all = beh['isRew'].astype(int)

print(f"X_all shape: {X_all.shape}")
print(f"y_all shape: {y_all.shape}")

# train/test split
X_train, X_test, y_train, y_test = train_test_split(X_all, y_all, train_size=0.8, random_state=42)

print(f"Number of samples in train set: {len(y_train)}")
print(f"Number of samples in test set: {len(y_test)}")

# Count number of samples
n_train = len(y_train)
n_test = len(y_test)

# Bar plot
plt.figure(figsize=(6, 4))
plt.bar(['Train Set', 'Test Set'], [n_train, n_test], color=['blue', 'red'])
plt.title('Number of samples in Train vs Test sets')
plt.ylabel('Number of samples')
plt.grid(axis='y', alpha=0.6)
plt.tight_layout()
plt.show()

# convert to pytorch tensors
X_train_tensor = torch.tensor(X_train, dtype=torch.float32)  # batch, channels, time
y_train_tensor = torch.tensor(y_train, dtype=torch.long)
X_test_tensor = torch.tensor(X_test, dtype=torch.float32)
y_test_tensor = torch.tensor(y_test, dtype=torch.long)

train_dataset = TensorDataset(X_train_tensor, y_train_tensor)
train_loader = DataLoader(train_dataset, batch_size=32, shuffle=True)

import torch.nn as nn
import torch.optim as optim

class SimpleCNNDecoder(nn.Module):
    def __init__(self, n_neurons, n_timepoints):
        super().__init__()
        self.conv = nn.Sequential(
            nn.Conv1d(in_channels=n_neurons, out_channels=1000, kernel_size=3, padding=1),
            nn.ReLU(),
            nn.AdaptiveAvgPool1d(1)  # Output (batch, 16, 1)
        )
        self.fc = nn.Sequential(
            nn.Flatten(),
            nn.Linear(16, 2)       # Output 2 classes
        )

    def forward(self, x):
        x = self.conv(x)
        return self.fc(x)

# Instantiate the model
model = SimpleCNNDecoder(n_neurons=X_all.shape[1], n_timepoints=X_all.shape[2])
optimizer = optim.Adam(model.parameters(), lr=0.001)
criterion = nn.CrossEntropyLoss()

# training loop
n_epochs = 10
for epoch in range(n_epochs):
    model.train()
    total_loss = 0
    for batch_X, batch_y in train_loader:
        optimizer.zero_grad()
        outputs = model(batch_X)
        loss = criterion(outputs, batch_y)
        loss.backward()
        optimizer.step()
        total_loss += loss.item()
    print(f"Epoch {epoch+1}/{n_epochs} - Loss: {total_loss:.4f}")

# eval
model.eval()
with torch.no_grad():
    outputs = model(X_test_tensor)
    predicted_labels = torch.argmax(outputs, dim=1)
    test_accuracy = (predicted_labels == y_test_tensor).float().mean().item()

print(f"\n Accuracy(test): {test_accuracy:.2f}")

from torch.utils.data import TensorDataset, DataLoader

# Create test dataset
test_dataset = TensorDataset(X_test_tensor, y_test_tensor)

# Create test DataLoader
test_loader = DataLoader(test_dataset, batch_size=16, shuffle=False)

from sklearn.metrics import confusion_matrix, ConfusionMatrixDisplay

model.eval()  # Set the model to evaluation mode

# Collect all predictions and true labels
all_preds = []
all_labels = []

with torch.no_grad():
    for x_batch, y_batch in test_loader:  # test_loader = DataLoader for your test set
        outputs = model(x_batch)
        _, predicted = torch.max(outputs, 1)  # Get predicted class index
        all_preds.extend(predicted.cpu().numpy())
        all_labels.extend(y_batch.cpu().numpy())

# Convert to numpy arrays
all_preds = np.array(all_preds)
all_labels = np.array(all_labels)

# Compute confusion matrix
cm = confusion_matrix(all_labels, all_preds)

# Plot confusion matrix
disp = ConfusionMatrixDisplay(confusion_matrix=cm, display_labels=["Class 0", "Class 1"]) # check which one is lick or not to lick
disp.plot(cmap=plt.cm.Blues)
plt.title("Confusion Matrix")
plt.show()